import React, { Component } from 'react';
import {Link} from 'react-router-dom';

class MyAccountMenu extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="myAccountLinks">
                <Link to="">My Account</Link>
                <Link to="">My Account</Link>
                <Link to="">My Account</Link>
                <Link to="">My Account</Link>
                <Link to="">My Account</Link>
                <Link to="">My Account</Link>
            </div>
        )
    }
}
export default MyAccountMenu;
